import React, { Component } from 'react'
import { Route } from "react-router-dom";
import "../../styles/navbar/navbar.scss";
import Logo from "../../images/NHSCT.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUser, faSignInAlt, faGraduationCap } from "@fortawesome/free-solid-svg-icons"


export default class Navbar extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="navbar">
                <header className="header">
                    <div className="logo">
                        <Route to={'/login'}>
                            <img width="100%" src={Logo} alt="logo" />
                        </Route>
                    </div>
                    <div className="navComponents">
                        <ul>
                            <li>
                                <a onClick={() => { window.location.href = "/login" }}>
                                    <FontAwesomeIcon icon={faSignInAlt} size="1x" style={{ color: "darkgray" }} />
                                </a>
                            </li>
                            <li>
                                <a onClick={() => { window.location.href = "/personal-profile" }}>
                                    <FontAwesomeIcon icon={faUser} size="1x" style={{ color: "darkgray" }} />
                                </a>
                            </li>
                            <li>
                                <a onClick={() => { window.location.href = "/learning-profile" }}>
                                    <FontAwesomeIcon icon={faGraduationCap} size="1x" style={{ color: "darkgray" }} />
                                </a>
                            </li>

                        </ul>

                    </div>
                </header>
            </div>
        );
    }
}
